import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [file, setFile] = useState(null);
  const [status, setStatus] = useState('Idle');
  const [assetID, setAssetID] = useState('');
  const apiToken = 'eyJhbGciOiJSUzI1NiIsInR5cCIgOiAiSldUIiwia2lkIiA6ICJuSnVpYzVwbXk1T1hGSjVmY1RIQTdUNVktRHZVbVVOR2xxVHBqS0hDVnU4In0..TbeNLV0m5lqWc_NF0Mhq5rIKrYtXZHiKnEq4zeWVgauZhS_aH736DhcRnth020U1eHVAVsHQA18-vQcTgvxi2_np5v64N9fyX1kpohxQDe8hyTrdGr6anJiDpMPSzbDZWXHKrBuMxJ8nVJuTSc6RZ-AhPJxHPsRVvQ7yEB8LVtCCVIMf-PMh2mW1B0rDN93ltkGPbd40dQG71zijT7HALcMjyEiSfwuRm8RsMyogE11Kjtd2oBNIgKRtGgN-i1Ha4_aLlooXfTWZOPnwhzy6qX7Q8Tf_cJ7mGTXyRtU--Hqaeh2DxFYkO7VCMoba6GusTAE2ZF96ew-r93mVBfsoQQ';

  const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const createAvatar = async () => {
    setStatus('Creating Avatar...');
    try {
      const response = await axios.post('https://api.meshcapade.com/api/v1/avatars/create/from-images', {}, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      const newAssetID = response.data.data.id; // Update according to actual API response structure
      setAssetID(newAssetID);
      setStatus('Avatar Created');
      return newAssetID;
    } catch (error) {
      console.error('Error creating avatar:', error);
      setStatus('Error Creating Avatar');
    }
  };

  const generateUploadLink = async (assetID) => {
    try {
      const response = await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/images`, {}, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      // Assuming the response contains the upload URL or instructions on how to construct it
      const uploadDetails = response.data;
      return uploadDetails;
    } catch (error) {
      console.error('Error generating upload link:', error);
      throw new Error('Failed to generate upload link');
    }
  };




  const uploadImage = async (assetID, file) => {
    try {
      const uploadDetails = await generateUploadLink(assetID);
      if (!uploadDetails.uploadUrl) {
        throw new Error('Upload URL is undefined.');
      }

      const formData = new FormData();
      formData.append('file', file);
      await axios.post(uploadDetails.uploadUrl, formData, {
        headers: {
          'Authorization': `Bearer ${apiToken}`,
          'Content-Type': 'multipart/form-data',
        },
      });
      console.log('Image uploaded successfully');
    } catch (error) {
      console.error('Error uploading image:', error.response ? error.response.data : error.message);
      throw new Error('Failed to upload image');
    }
  };



  const startFittingProcess = async (assetID) => {
    setStatus('Starting Fitting Process...');
    try {
      await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/fit-to-images`, {}, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      setStatus('Fitting Process Started');
    } catch (error) {
      console.error('Error starting fitting process:', error);
      setStatus('Error Starting Fitting Process');
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!file) {
      alert('Please select a file.');
      return;
    }

    const createdAssetID = await createAvatar();
    if (createdAssetID) {
      await uploadImage(createdAssetID);
      await startFittingProcess(createdAssetID);
      // Consider implementing polling or a callback mechanism to check the status of the fitting process
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input type="file" onChange={handleFileChange} />
        <button type="submit">Upload and Create Avatar</button>
      </form>
      <div>Status: {status}</div>
      {assetID && <div>Asset ID: {assetID}</div>}
    </div>
  );
}

export default App;
